	(30, 'PVPZone01', 3, 0, 1, 'Alterac Valley', '', '', 'Vallée d\'Alterac', 'Alteractal', '', '奥特兰克山谷', '', '', 'Valle de Alterac', '', 'Альтеракская долина', '', '', '', '', 16712190, 0, 'Hidden within the Alterac Mountains, Alterac Valley is the home of Thrall\'s own clan of orcs, the Frostwolves.\r\n\r\nThe Stormpike dwarves have established a foothold in the valley and seek to plumb its depths for riches and links to their ancestral past.\r\n\r\nThe territorial Frostwolves, unwilling to suffer the dwarven incursion, have rallied an army... an army eager for righteous slaughter.', '', '', 'Cachée dans les montagnes d’Alterac, la vallée d’Alterac est le domaine des Loups-de-givre, le clan natal de Thrall.\r\n\r\nLes nains Foudrepique, à la recherche de richesses et d’indices sur leur passé, y ont établi une tête de pont.\r\n\r\nLes Loups-de-givre, très attachés à leur territoire, ne tolèrent pas cette intrusion. Ils ont levé une armée… une armée qui rêve de massacres perpétrés au nom d’une juste cause.', 'Verborgen im Alteracgebirge liegt das Alteractal, das Zuhause von Thralls Orcklan, den Frostwölfen.\r\n\r\nDie Zwerge des Sturmlanzenklans haben einen Stützpunkt im Tal errichtet und dringen auf der Suche nach Reichtümern und Hinweisen auf die Vergangenheit ihrer Vorfahren in die Tiefen des Tals vor.\r\n\r\nDie hier lebenden Frostwölfe, nicht willens, das Eindringen der Zwerge hinzunehmen, haben eine Armee aufgestellt... eine Armee, die nach einer Schlacht für die gerechte Sache giert.', '', '在奥特兰克山脉的深处，是萨尔的嫡系氏族——霜狼氏族的家园，奥特兰克山谷。\r\n\r\n矮人中的雷矛部族在这里建造了一座要塞，并试图深入山谷寻找宝藏，还有关于他们起源的线索。\r\n\r\n无法忍受这种侵犯的霜狼氏族已经集结了一支军队，随时准备与敌人展开血战。', '', '', 'Oculto entre las montañas de Alterac, el Valle de Alterac es el hogar del clan de orcos de Thrall, los Lobo Gélido.\r\n\r\nLos enanos Pico Tormenta han construido un bastión en el valle e intentan hacerse con sus recursos, así como encontrar vínculos con su pasado.\r\n\r\nLos territoriales Lobo Gélido, en su afán por expulsar al invasor enano, han formado un ejército sediento de sangre.', '', 'Альтеракская долина, затерянная среди одноименных гор, служит домом орочьему клану Северного Волка, к которому принадлежит сам Тралл.\r\n\r\nДворфы Грозовой Вершины вторглись в эту долину в поисках подземных сокровищ и знаний о своем прошлом.\r\n\r\nНе желая терпеть чужаков, орки собрали армию... армию, готовую к жестокой и праведной битве.', '', '', '', '', 16712190, 'Hidden within the Alterac Mountains, Alterac Valley is the home of Thrall\'s own clan of orcs, the Frostwolves.\r\n\r\nThe Stormpike dwarves have established a foothold in the valley and seek to plumb its depths for riches and links to their ancestral past.\r\n\r\nThe territorial Frostwolves, unwilling to suffer the dwarven incursion, have rallied an army... an army eager for righteous slaughter.', '', '', 'Cachée dans les montagnes d’Alterac, la vallée d’Alterac est le domaine des Loups-de-givre, le clan natal de Thrall.\r\n\r\nLes nains Foudrepique, à la recherche de richesses et d’indices sur leur passé, y ont établi une tête de pont.\r\n\r\nLes Loups-de-givre, très attachés à leur territoire, ne tolèrent pas cette intrusion. Ils ont levé une armée… une armée qui rêve de massacres perpétrés au nom d’une juste cause.', 'Verborgen im Alteracgebirge liegt das Alteractal, das Zuhause von Thralls Orcklan, den Frostwölfen.\r\n\r\nDie Zwerge des Sturmlanzenklans haben einen Stützpunkt im Tal errichtet und dringen auf der Suche nach Reichtümern und Hinweisen auf die Vergangenheit ihrer Vorfahren in die Tiefen des Tals vor.\r\n\r\nDie hier lebenden Frostwölfe, nicht willens, das Eindringen der Zwerge hinzunehmen, haben eine Armee aufgestellt... eine Armee, die nach einer Schlacht für die gerechte Sache giert.', '', '在奥特兰克山脉的深处，是萨尔的嫡系氏族——霜狼氏族的家园，奥特兰克山谷。\r\n\r\n矮人中的雷矛部族在这里建造了一座要塞，并试图深入山谷寻找宝藏，还有关于他们起源的线索。\r\n\r\n无法忍受这种侵犯的霜狼氏族已经集结了一支军队，随时准备与敌人展开血战。', '', '', 'Oculto entre las montañas de Alterac, el Valle de Alterac es el hogar del clan de orcos de Thrall, los Lobo Gélido.\r\n\r\nLos enanos Pico Tormenta han construido un bastión en el valle e intentan hacerse con sus recursos, así como encontrar vínculos con su pasado.\r\n\r\nLos territoriales Lobo Gélido, en su afán por expulsar al invasor enano, han formado un ejército sediento de sangre.', '', 'Альтеракская долина, затерянная среди одноименных гор, служит домом орочьему клану Северного Волка, к которому принадлежит сам Тралл.\r\n\r\nДворфы Грозовой Вершины вторглись в эту долину в поисках подземных сокровищ и знаний о своем прошлом.\r\n\r\nНе желая терпеть чужаков, орки собрали армию... армию, готовую к жестокой и праведной битве.', '', '', '', '', 16712190, 104, 1, -1, 0, 0, -1, 0, 0, 0),
