	(607, 'NorthrendBG', 3, 29, 1, 'Strand of the Ancients', '', '', 'Rivage des Anciens', 'Strand der Uralten', '', '远古海滩', '', '', 'Playa de los Ancestros', '', 'Берег Древних', '', '', '', '', 16712190, 0, 'To the south of Dragonblight lies the resting place of a legendary Titan artifact, known by the Alliance and Horde to possess critical information regarding the Titans and their methods.\r\n\r\nPrepare yourself for battle, for fate cannot determine success upon this Strand of the Ancients.', '', '', 'Un artéfact légendaire des titans repose au sud de la Désolation des dragons. La Horde et l’Alliance estiment qu’il renferme des informations capitales sur les titans et leurs méthodes.\r\n\r\nPréparez-vous au combat, car sur le rivage des Anciens, le destin ne compte pas.', 'Im Süden der Drachenöde liegt die Ruhestätte eines legendären Titanenartefakts. Sowohl der Allianz als auch der Horde ist bekannt, dass dieses Objekt entscheidende Informationen über die Titanen und ihre Vorgehensweise enthält.\r\n\r\nMacht Euch zur Schlacht bereit, denn am Strand der Uralten entscheidet nicht das Schicksal über den Sieger.', '', '在龙骨荒野的南面有一处保存着古代泰坦神器的圣殿，联盟和部落都想要夺取这件神器，以获得有关泰坦的重要情报。\r\n\r\n做好战斗的准备吧，在这片远古海滩的战斗中，命运并非决定性的因素。', '', '', 'Al sur del Cementerio de Dragones yace un legendario artefacto de los titanes. Tanto la Alianza como la Horda piensan que encierra información crítica sobre los titanes y sus métodos.\r\n\r\nPrepárate para la batalla, ya que el destino no decide el éxito en la Playa de los Ancestros.', '', 'К югу от Драконьего Погоста лежат земли, в которых хранится древняя реликвия титанов. И Орде, и Альянсу известно, что она способна приоткрыть завесу тайны над историей этих древних творцов.\r\n\r\nПриготовьтесь к битве – судьба Берега Древних теперь зависит и от вас.', '', '', '', '', 16712190, 'To the south of Dragonblight lies the resting place of a legendary Titan artifact, known by the Alliance and Horde to possess critical information regarding the Titans and their methods.\r\n\r\nPrepare yourself for battle, for fate cannot determine success upon this Strand of the Ancients.', '', '', 'Un artéfact légendaire des titans repose au sud de la Désolation des dragons. La Horde et l’Alliance estiment qu’il renferme des informations capitales sur les titans et leurs méthodes.\r\n\r\nPréparez-vous au combat, car sur le rivage des Anciens, le destin ne compte pas.', 'Im Süden der Drachenöde liegt die Ruhestätte eines legendären Titanenartefakts. Sowohl der Allianz als auch der Horde ist bekannt, dass dieses Objekt entscheidende Informationen über die Titanen und ihre Vorgehensweise enthält.\r\n\r\nMacht Euch zur Schlacht bereit, denn am Strand der Uralten entscheidet nicht das Schicksal über den Sieger.', '', '在龙骨荒野的南面有一处保存着古代泰坦神器的圣殿，联盟和部落都想要夺取这件神器，以获得有关泰坦的重要情报。\r\n\r\n做好战斗的准备吧，在这片远古海滩的战斗中，命运并非决定性的因素。', '', '', 'Al sur del Cementerio de Dragones yace un legendario artefacto de los titanes. Tanto la Alianza como la Horda piensan que encierra información crítica sobre los titanes y sus métodos.\r\n\r\nPrepárate para la batalla, ya que el destino no decide el éxito en la Playa de los Ancestros.', '', 'К югу от Драконьего Погоста лежат земли, в которых хранится древняя реликвия титанов. И Орде, и Альянсу известно, что она способна приоткрыть завесу тайны над историей этих древних творцов.\r\n\r\nПриготовьтесь к битве – судьба Берега Древних теперь зависит и от вас.', '', '', '', '', 16712190, 238, 1, 0, 0, 0, -1, 2, 0, 0),
