	(628, 'IsleofConquest', 3, 29, 1, 'Isle of Conquest', '', '', 'Île des Conquérants', 'Insel der Eroberung', '', '征服之岛', '', '', 'Isla de la Conquista', '', 'Остров Завоеваний', '', '', '', '', 16712190, 0, 'The Isle of Conquest is a point of strategic importance for the Alliance and Horde campaigns in Northrend.\r\n\r\nServing as an ideal staging ground for operations in Icecrown, each side is determined to secure control of the island.\r\n\r\nWith the 7th Legion and the Kor\'kron Guard locked in deadly combat, both factions have issued a call to arms in hopes of tipping the scales in their favor and defeating the opposing general.', '', '', 'L\'île des Conquérants est un point stratégique très important pour la Horde et l\'Alliance en Norfendre.\r\n\r\nChaque camp est déterminé à prendre le contrôle de ce point de ravitaillement idéal pour les opérations dans la Couronne de glace.\r\n\r\nLa 7e Légion et la garde kor\'kronne s\'y affrontent dans un combat à mort. Les deux factions ont lancé un appel aux armes dans l\'espoir de faire pencher la balance en leur faveur et de vaincre le général ennemi.', 'Die Insel der Eroberung ist sowohl für die Allianz als auch die Horde in Nordend gleichermaßen strategisch wichtig.\r\n\r\nDie Insel ist ein idealer Ausgangspunkt für Operationen in Eiskrone und beide Seiten ringen um die Vorherrschaft.\r\n\r\nDie 7. Legion und die Wache der Kor\'kron sind im Kampf verkeilt und rufen nun zu den Waffen, um sich einen Vorteil zu verschaffen und den gegnerischen General zu Fall zu bringen.', '', '征服之岛是联盟与部落在诺森德的必争之地。\r\n\r\n这块小岛是在冰冠冰川进行战略部署的理想区域，所以部落和联盟都要巩固己方在这里的控制权。\r\n\r\n第七军团与库卡隆守卫在这里的死斗陷入了胶结，双方都已发出了战争的召唤，希望借此扩充兵力并消灭对方。', '', '', 'La Isla de la Conquista es un punto estratégico de las campañas de la Horda y la Alianza en Rasganorte.\r\n\r\nSirve como punto de partida para las operaciones en Corona de Hielo, cada bando está decidido a conseguir el control de la isla.\r\n\r\nLa Séptima Legión y la Guardia de Kor\'kron están enzarzadas en un combate letal, ambas facciones han hecho un llamamiento a las armas con la esperanza de inclinar la balanza a su favor y de derrotar al general contrario.', '', 'Остров Завоеваний – стратегически важная территория, захватить которую стремятся экспедиции Орды и Альянса.\r\n\r\nКаждой из сторон Остров мог бы послужить отличной отправной точкой для проведения операций в Ледяной Короне.\r\n\r\nСедьмой легион Альянса и Кор\'крон Орды вовлечены в кровопролитные бои в надежде склонить чашу весов в свою сторону и победить генерала противника.', '', '', '', '', 16712190, 'The Isle of Conquest is a point of strategic importance for the Alliance and Horde campaigns in Northrend.\r\n\r\nServing as an ideal staging ground for operations in Icecrown, each side is determined to secure control of the island.\r\n\r\nWith the 7th Legion and the Kor\'kron Guard locked in deadly combat, both factions have issued a call to arms in hopes of tipping the scales in their favor and defeating the opposing general.', '', '', 'L\'île des Conquérants est un point stratégique très important pour la Horde et l\'Alliance en Norfendre.\r\n\r\nChaque camp est déterminé à prendre le contrôle de ce point de ravitaillement idéal pour les opérations dans la Couronne de glace.\r\n\r\nLa 7e Légion et la garde kor\'kronne s\'y affrontent dans un combat à mort. Les deux factions ont lancé un appel aux armes dans l\'espoir de faire pencher la balance en leur faveur et de vaincre le général ennemi.', 'Die Insel der Eroberung ist sowohl für die Allianz als auch die Horde in Nordend gleichermaßen strategisch wichtig.\r\n\r\nDie Insel ist ein idealer Ausgangspunkt für Operationen in Eiskrone und beide Seiten ringen um die Vorherrschaft.\r\n\r\nDie 7. Legion und die Wache der Kor\'kron sind im Kampf verkeilt und rufen nun zu den Waffen, um sich einen Vorteil zu verschaffen und den gegnerischen General zu Fall zu bringen.', '', '征服之岛是联盟与部落在诺森德的必争之地。\r\n\r\n这块小岛是在冰冠冰川进行战略部署的理想区域，所以部落和联盟都要巩固己方在这里的控制权。\r\n\r\n第七军团与库卡隆守卫在这里的死斗陷入了胶结，双方都已发出了战争的召唤，希望借此扩充兵力并消灭对方。', '', '', 'La Isla de la Conquista es un punto estratégico de las campañas de la Horda y la Alianza en Rasganorte.\r\n\r\nSirve como punto de partida para las operaciones en Corona de Hielo, cada bando está decidido a conseguir el control de la isla.\r\n\r\nLa Séptima Legión y la Guardia de Kor\'kron están enzarzadas en un combate letal, ambas facciones han hecho un llamamiento a las armas con la esperanza de inclinar la balanza a su favor y de derrotar al general contrario.', '', 'Остров Завоеваний – стратегически важная территория, захватить которую стремятся экспедиции Орды и Альянса.\r\n\r\nКаждой из сторон Остров мог бы послужить отличной отправной точкой для проведения операций в Ледяной Короне.\r\n\r\nСедьмой легион Альянса и Кор\'крон Орды вовлечены в кровопролитные бои в надежде склонить чашу весов в свою сторону и победить генерала противника.', '', '', '', '', 16712190, 245, 1, 0, 0, 0, -1, 2, 0, 0),
